import React, { useState } from 'react';
import { Clapperboard, Code, Film, User, Mail, Phone, MapPin, ChevronDown, ChevronUp, X } from 'lucide-react';
import Modal from 'react-modal';

Modal.setAppElement('#root');

const App = () => {
  const [activeSection, setActiveSection] = useState('compositing');
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [modalContent, setModalContent] = useState(null);

  const NavItem = ({ id, icon: Icon, label }) => (
    <button
      onClick={() => setActiveSection(id)}
      className={`w-full flex items-center px-4 py-3 rounded-lg transition-all duration-200 hover:bg-gray-100 ${
        activeSection === id 
          ? 'bg-black text-white hover:bg-black/90' 
          : 'text-gray-600 hover:text-black'
      }`}
    >
      <Icon size={20} className="min-w-[20px]" />
      <span className="ml-3 text-sm font-medium whitespace-nowrap">{label}</span>
    </button>
  );

  const ProjectCard = ({ title, description, duration, expandedContent }) => {
    const handleExpand = () => {
      setModalContent(
        <div className="space-y-4">
          <h2 className="text-2xl font-bold mb-4">{title}</h2>
          {duration && <p className="text-sm text-gray-500 mb-3">{duration}</p>}
          <div>{expandedContent}</div>
        </div>
      );
      setIsModalOpen(true);
    };

    return (
      <div className="bg-white border border-gray-200 rounded-xl p-6 hover:shadow-lg transition-shadow duration-200">
        <div className="flex justify-between items-start">
          <div>
            <h3 className="text-xl font-semibold text-gray-900 mb-2">{title}</h3>
            {duration && <p className="text-sm text-gray-500 mb-3">{duration}</p>}
          </div>
          <button
            onClick={handleExpand}
            className="p-1 hover:bg-gray-100 rounded-full transition-colors"
          >
            <ChevronDown className="text-gray-600" size={20} />
          </button>
        </div>
        <p className="text-gray-600">{description}</p>
      </div>
    );
  };

  const sections = [
    { id: 'compositing', icon: Clapperboard, label: 'Compositing' },
    { id: 'technical', icon: Code, label: 'Technical' },
    { id: 'motion', icon: Film, label: 'Motion' },
    { id: 'personal', icon: User, label: 'Personal' }
  ];

  const renderContent = () => {
    switch (activeSection) {
      case 'compositing':
        return (
          <div className="space-y-8">
            <h1 className="text-4xl font-bold text-gray-900 mb-4">VFX & Compositing</h1>
            <p className="text-xl text-gray-600 max-w-2xl">
              Experienced Nuke Compositor with 3 years of expertise in creating seamless visual effects. 
              Currently working at Incognito studio s.r.o. on feature films and commercial projects.
            </p>
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
              <ProjectCard 
                title="Rosa & Dara Feature Film"
                duration="2021 - Present"
                description="Working on 'Rosa & Dara a jejich velké letní dobrodružství', a 3D feature film blending 2D and 3D animation techniques."
                expandedContent={
                  <div>
                    <h4 className="font-semibold mb-2">Key Responsibilities:</h4>
                    <ul className="list-disc pl-5 space-y-2 text-gray-600">
                      <li>Lead compositor for character integration scenes</li>
                      <li>Developed custom Nuke tools for pipeline optimization</li>
                      <li>Collaborated with 3D artists for seamless integration</li>
                      <li>Supervised junior compositors</li>
                    </ul>
                  </div>
                }
              />
              {/* Additional ProjectCards can be added here */}
            </div>
          </div>
        );
      // Additional cases for other sections
      default:
        return null;
    }
  };

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Sidebar */}
      <nav className="fixed top-0 left-0 h-full w-64 bg-white border-r border-gray-200 p-6">
        <div className="h-full flex flex-col">
          {/* Logo */}
          <div className="mb-8">
            <h2 className="text-2xl font-bold text-gray-900">Martin Tomek</h2>
            <p className="text-sm text-gray-500 mt-1">Motion Designer & VFX Artist</p>
          </div>
          {/* Navigation */}
          <div className="space-y-2">
            {sections.map((section) => (
              <NavItem
                key={section.id}
                id={section.id}
                icon={section.icon}
                label={section.label}
              />
            ))}
          </div>
          {/* Footer */}
          <div className="mt-auto pt-6 border-t border-gray-200">
            <p className="text-sm text-gray-500">Available for new opportunities</p>
            <p className="text-sm text-gray-500 mt-1">Willing to relocate to Canary Islands</p>
          </div>
        </div>
      </nav>
      {/* Main Content */}
      <main className="ml-64 p-8">
        {renderContent()}
      </main>
      {/* Modal for expanded content */}
      <Modal
        isOpen={isModalOpen}
        onRequestClose={() => setIsModalOpen(false)}
        className="bg-white rounded-lg shadow-lg p-8 max-w-3xl mx-auto mt-20"
        overlayClassName="fixed inset-0 bg-black bg-opacity-50 flex justify-center items-center"
      >
        <button
          onClick={() => setIsModalOpen(false)}
          className="absolute top-4 right-4 p-1 hover:bg-gray-100 rounded-full transition-colors"
        >
          <X size={24} className="text-gray-600" />
        </button>
        {modalContent}
      </Modal>
    </div>
  );
};

export default App;
